import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import styles from './Navigation.module.css';

function Navigation(){
    const [isActive, setActive] = useState("false");

    const handleToggle = () => {
      setActive(!isActive);
    };

    return ( 
            <nav className={styles.navBar}>
                <div className={styles.menu}>
                    <ul className>
                        <li className={styles.navBarEntry}><Link to = '/'>About Us</Link></li>
                        <li className={styles.navBarEntry}><Link to = '/'>Registration</Link></li>
                    </ul>
                </div>
                <button id = "menuButton1" className={styles.menuButton.isActive} onClick = {handleToggle}>
                    <span className={styles.buttonLine}></span>
                    <span className={styles.buttonLine}></span>
                    <span className={styles.buttonLine}></span>
                </button>
            </nav>
    );
}
export default Navigation;
